function Logic() {
  const handleClick = (amount, length) => {
    console.log(length);
    if (amount === length) {
      return 1;
    } else if (amount === 0) {
      return length;
    }
    return amount;
  };

  return {
    handleClick,
  };
}

export default Logic;
